import React, { Component } from 'react';
import "../styles/aboutMe.css"

class AboutMe extends Component {
    render() {
        return (
            <div className="aboutMe">
                <div className="bio">
                    <h4>About Me</h4>
                </div>
                <div className="resume">
                    <h4>My Resume</h4>

                </div>
            </div>
        );
    }
}

export default AboutMe;
